import React from 'react';
import Data from './Data.json';
import Items from './Items.jsx';
import './all.css';
import {useState,useEffect} from 'react';
export const Update=()=>{
    const [items, setItems] = useState([]);
            useEffect(() => {
                fetch("http://localhost:8080/product/all") // Fetching from backend
                    .then((response) => response.json())
                    .then((data) => setItems(data))
                    .catch((error) => console.error("Error fetching items:", error));
                }, []);
    return(
        <div className="product-list">
          {Data.map((item,i)=>{
               return <Items key={i} id={item.id} price={item.price} name={item.name} image={item.imageUrl} action="Modify Price"/>
              })}
          </div>
)
}

export const All=()=>{

    const [items, setItems] = useState([]);
        useEffect(() => {
            fetch("http://localhost:8080/product/all") // Fetching from backend
                .then((response) => response.json())
                .then((data) => setItems(data))
                .catch((error) => console.error("Error fetching items:", error));
            }, []);
    return(
        <div className="product-list">
          {items.map((item,i)=>{
               return <Items key={i} id={item.id} price={item.price} name={item.name} image={item.imageUrl} action="Add to Cart"/>
              })}
          </div>
)
}

 export const Add = () => {
  const [productname,setProductName]=useState();

   const handleChange = (e) => {
     const { name, value } = e.target;
     setProduct((prevProduct) => ({
       ...prevProduct,
       [name]: name === "price" ? Number(value) : value, // Convert price to number
     }));
   };

   const handleSubmit = async (e) => {
     e.preventDefault();
     try {
       const response = await fetch("http://localhost:8080/products/add", {
         method: "POST",
         headers: { "Content-Type": "application/json" },
         body: JSON.stringify(product),
       });

       if (response.ok) {
         alert("Product added successfully!");
         setProduct({ name: "", price: "", imageUrl: "", Category: "" }); // Reset form
       } else {
         alert("Failed to add product.");
       }
     } catch (error) {
       console.error("Error:", error);
     }
   };

   return (
     <form onSubmit={handleSubmit}>
       <div className="form">
         <div className="mb-3">
           <label htmlFor="name" className="form-label">Name of the product</label>
           <input
             type="text"
             className="form-control"
             id="name"
             name="name"
             placeholder="Product Name"
             value={productname}
             onChange={handleChange}
             required
           />
         </div>

         <div className="mb-3">
           <label htmlFor="imageUrl" className="form-label">Image Url</label>
           <input
             type="text"
             className="form-control"
             id="imageUrl"
             name="imageUrl"
             placeholder="Enter Image Url"
             value={product.imageUrl}
             onChange={handleChange}
             required
           />
         </div>

         <div className="mb-3">
           <label htmlFor="Category" className="form-label">Price Category</label>
           <select
             className="form-select"
             name="Category"
             value={product.Category}
             onChange={handleChange}
             required
           >
             <option value="">Select a category</option>
             <option value="grams">Price in grams</option>
             <option value="item">Price per item</option>
           </select>
         </div>

         <div className="mb-3">
           <label htmlFor="price" className="form-label">Price</label>
           <input
             type="number"
             className="form-control"
             id="price"
             name="price"
             placeholder="Enter price"
             value={product.price}
             onChange={handleChange}
             required
           />
         </div>

         <div className="col-12">
           <button className="btn btn-primary" type="submit">Submit</button>
         </div>
       </div>
     </form>
   );
 };
